import torchimport torch.nn as nnimport torch.nn.functional as F# model ---------------------------------------------------------class Generator(nn.Module):    def __init__(self):        super(Generator, self).__init__()        self.fc1 = nn.Linear(1, 14)        self.fc2 = nn.Linear(14, 196)        self.fc3 = nn.Linear(196, 784)    def forward(self, x):        x = F.leaky_relu(self.fc1(x))        x = F.leaky_relu(self.fc2(x))        x = F.tanh(self.fc3(x))        return xclass Discriminator(nn.Module):    def __init__(self):        super(Discriminator, self).__init__()        self.fc1 = nn.Linear(784, 196)        self.fc1_bn = nn.BatchNorm1d(196)        self.fc2 = nn.Linear(196, 14)        self.fc2_bn = nn.BatchNorm1d(14)        self.fc3 = nn.Linear(14, 1)    def forward(self, x):        x = x.view(-1, 784)        x = x.data        # if torch.isnan(x).max() == 1:        #     print('----------- first x --------------')        #     print(x)        x = F.leaky_relu(self.fc1(x))        # if torch.isnan(x).max() == 1:        #     print('----------- first x --------------')        #     print(x_copy)        #     print('----------- second x --------------')        #     print(x)        x = F.leaky_relu(self.fc2(x))        # if torch.isnan(x).max() == 1:        #     print('----------- third x --------------')        #     print(x)        x = F.sigmoid(self.fc3(x))        # if torch.isnan(x).max() == 1:        #     print('----------- fourth x --------------')        #     print(x)        return x